import React from "react";
import "./Home.css";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="home-container" style={styles.container}>
      <h1 style={styles.title}>Chào mừng bạn đến Website</h1>
      <p style={styles.subtitle}>Vui lòng chọn chức năng:</p>
      <div style={styles.buttons}>
        <Link to="/login" style={{ ...styles.btn, background: "#667eea" }}>
          Đăng nhập
        </Link>
        <Link to="/signup" style={{ ...styles.btn, background: "#e056fd" }}>
          Đăng ký
        </Link>
      </div>
    </div>
  );
}

const styles = {
  container: {
    textAlign: "center",
    padding: "50px",
  },
  title: {
    fontSize: "28px",
    marginBottom: "10px",
  },
  subtitle: {
    marginBottom: "20px",
    color: "#555",
  },
  buttons: {
    display: "flex",
    justifyContent: "center",
    gap: "20px",
  },
  btn: {
    padding: "12px 24px",
    color: "#fff",
    borderRadius: "8px",
    textDecoration: "none",
    transition: "0.3s",
  },
};
